TITLE:
  - shear flow with moving circular embedded fluid
PROBLEM TYPE:
  PROBLEMTYPE: "Fluid_Ale"
IO:
  OUTPUT_GMSH: true
  FILESTEPS: 1
FLUID DYNAMIC:
  LINEAR_SOLVER: 1
  NONLINITER: Newton
  INITIALFIELD: "field_by_function"
  RESTARTEVERY: 2
  NUMSTEP: 8
  STARTFUNCNO: 2
  TIMESTEP: 1
  MAXTIME: 10
  THETA: 1
